# Step 1: Create a new dictionary where the date is the key and only total profit/loss for each day
date_summary = {}

# Initialize a new dictionary to store the total loss and profit per date
summary = {}

# Populate the summary dictionary
for pair, data in trading_data.items():
    for date, stats in data.items():
        if date not in summary:
            summary[date] = {'total_profit': 0, 'total_loss': 0, 'net_gain': 0}
        summary[date]['total_profit'] += stats['pips_profit']
        summary[date]['total_loss'] += stats['pips_loss']
        summary[date]['net_gain'] += stats['pips_profit'] - stats['pips_loss']

# Function to get the top n dates with the most losses
def top_n_dates_with_most_losses(summary, n=3):
    # Sort the dates by total_loss in descending order and select the top n
    sorted_dates = sorted(summary.items(), key=lambda x: x[1]['net_gain'], reverse=False) 
    return sorted_dates[:n]

# Specify the number of top dates to retrieve
n = 3

# Get the top n dates with the most losses
top_loss_dates = top_n_dates_with_most_losses(summary, n)

# User-defined number of forex pairs to return for each date
num_pairs_to_return = 9  # Change this value as needed

# Step 4: Identify forex pairs with the most pips loss for each date
pairs_with_max_loss = {}

for date, _ in top_loss_dates:
    # Create a list of (pair, loss) tuples and sort it by loss in ascending order
    loss_list = [(pair, dates[date]['net_gain']) for pair, dates in trading_data.items() if date in dates]
    sorted_loss_list = sorted(loss_list, key=lambda x: x[1], reverse=False) # ascending because negative number is smallest 'net gain' with most negative value

    # Return the top 'num_pairs_to_return' pairs or fewer if there are not enough pairs
    pairs_with_max_loss[date] = sorted_loss_list[:num_pairs_to_return]


